fields.relatorio:
Durante as 24horas, o serviço transcorreu da seguinte forma:

Período Matutino foi cumprido o cartão programa, com abordagens a veículos e pessoas;

Período Vespertino foi feito Rondas no centro comercial e bairros Adjacentes e cumprimento do cartão programa;

Período Noturno foi feito Rondas ostensivas, seguidas de abordagens à bares, veículos e pessoas. Com isso, o revezamento com a Guarnição B Ceto da Puma 8.1710, nos bairros pré estabelecidos. Por volta de 22:40hs, deslocamos para o município de Carinhanha, juntamente com a guarnição B Ceto da Puma 8.1710, sob o comando do Ten PM Prates. Onde lá havia tido judicialmente à impugnação da candidatura do prefeito Piau e por este motivo estava tendo baderna na cidade com motociclistas e perturbação do sossego alheio. Chegando no local, por determinação do Ten PM Prates, a polícia realizou apreensões de motocicletas envolvidas na referida baderna, e assim sanando o problema no local. Retornamos para Guanambi às 02hs da manhã.


Não havendo nada mais digno de registro, dou por encerrado este serviço.
